export default function ConfirmarProduto(props) {
    const { nome, precoDeFabrica, IPI, ICMS, Largura, Comprimento, Altura, show, handleCloseModal } = props;

    return (
        <div className={show}>
            <div className="modal-confirmacao">
                {/* Conteúdo do modal */}

                <div className="modal-buttons">
                    <button className="no-button" onClick={handleCloseModal}>Não</button>
                    <button className="yes-button" onClick={handleCloseModal}>Sim</button>
                </div>
            </div>
        </div>
    )
}
